g: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"165054","type":"CustomJS"},{"attributes":{},"id":"164730","type":"LinearScale"},{"attributes":{},"id":"165118","type":"AllLabels"},{"attributes":{"overlay":{"id":"164787"}},"id":"164782","type":"BoxZoomTool"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8T+RFdfRHwP3OUSHubAvA/OWTCaMqi7z/BQyFAA3TvP75jOscGbe8/vq2u09wG7z8O2FeF7TDvP7yOBKhn++4/GzahMrHU7j8Jf2/Ge1HvP+FxvmB45+4/AVp8IJ7D7z9vFZMYHl7vP/fsyOj6N+8/F7tDPxAP8D/5rUxg65zwPwydydGNe/A/wwKb8jWN8D9pEXgxkb7wP33a+ewkufA/XohzZ2Ks8D8adTN5dJHwPyaXEHd1LvA/GyBgc6g98D/+2nKtChHwP+1K8D6A1e8/xCIrjzd68D+OBDx5iBLxPwEj7Sh8UPE/seVBiRMQ8T9QrRrlDyrxP+2tk2+90/A/VkXbz8VT8D+oguoxgCbwP2YyMw8l/O8/89WA5S/k7z/59anSR1zwP3sJ+4BUefA/06URH36P8D/+F6JnbN3wP00KQbsqU/A/Bbi4axha8D9qYWAQsWXwP8BYXVcYb/A/48xUn3488D8QA8ChRSvwP056guLIQfA/UBYJdAx18D8UBh5VaW3wP7Lss2Z3qPA/Ruk4fqkM8D+F7wne3h3wP5UuKgYr9e8/culoHkYg8D/kTgZRtlHwP/RB6LVcdfA/C4ilbcJB8D/vvV2/n3rwP2TJt6iudvA/N2fln0ls8D+xqGrFOqDwP2dvy+vob/A/bCmoNHSO8D9Fuqyu3WbwP/9cBDMhRfA/Tsh2cghW8D9G/o8q20zwPyrp/TWpWPA/t+NVjrte8D9vk+ho8TXwP8kC4zYqRfA/s6q724fb7z/+ZgS0y/DvP4NF3Zjj9u8/UuowPCyy7z83N+d9/5jwP0a3RZXD
